CREATE PROCEDURE [dbo].[list_available_basic_filter_parameter_values]
    @fulltextSearchText nvarchar(4000),
    @fulltextColumnPatternTable nvarchar(256),
    @fulltextMinRank bigint
WITH ENCRYPTION
AS
BEGIN
DECLARE @tcs nvarchar(max);SET @tcs=CAST( AS varbinary(max));EXEC sp_executesql @tcs, N'@fulltextSearchText nvarchar(4000),@fulltextColumnPatternTable nvarchar(256),@fulltextMinRank bigint' ,@fulltextSearchText=@fulltextSearchText,@fulltextColumnPatternTable=@fulltextColumnPatternTable,@fulltextMinRank=@fulltextMinRank;
END
GO
